package main

import (
	"log"
	"strings"
	"testing"
)

func TestDay5(t *testing.T) {
	f := func(t *testing.T, input string, expect1 string, expect2 int) {
		one, two, err := day5(input)
		if err != nil {
			t.Fatal(err)
		}
		if one != expect1 {
			t.Fatalf("got %s, expected %s, len %d", one, expect1, len(one))
		}
		if two != expect2 {
			t.Fatalf("got %d, expected %d", two, expect2)
		}
	}
	s := t.Run("example", func(t *testing.T) { f(t, day5Example, "dabCBAcaDA", 4) })
	if s {
		t.Run("real", func(t *testing.T) { f(t, day5Input, day5Expected, 4934) })
	}
}

func day5(input string) (string, int, error) {
	part1 := day5Part1(input)
	alpha := "abcdefghijklmnopqrstuvwxyz"
	shortest := len(input)
	removed := ""
	for i := range alpha {
		l := string(alpha[i])
		L := string(alpha[i] - 32)
		test := strings.Replace(input, l, "", -1)
		test = strings.Replace(test, L, "", -1)
		p := day5Part1(test)
		//log.Printf("removed %s and got %s reduced to %s (%d)", string(alpha[i]), test, p, len(p))
		if len(p) < shortest {
			shortest = len(p)
			removed = string(alpha[i])
		}
	}
	log.Println("removed ", removed, " and got length ", shortest)
	return part1, shortest, nil
}

func day5Part1(input string) string {
	prev := input
	for cur := reducePairs(input); prev != cur; cur = reducePairs(cur) {
		//log.Println("RR ", prev, " ", cur)
		prev = cur
	}
	return prev
}

func reducePairs(input string) string {
	output := strings.Builder{}
	for i := 0; i < len(input)-1; i++ {
		l := input[i]
		last := input[i+1]
		if last-32 == l || last == l-32 {
			//log.Print(input, " ", i, " ", output.String(), " ", input[:i])
			output.WriteString(input[i+2:])
			return output.String()
		}
		output.WriteByte(l)
	}
	output.WriteByte(input[len(input)-1])
	return output.String()
}

